import ProductCard from '../components/ProductCard';
import axios from 'axios';
const ProductsScreen = () => {
  return (
    <Box>
      <ProductCard product={{ name: 'smartphone' }} loading={false} />
    </Box>
  );
};

export default ProductsScreen;
